body:
Traits such as the `IsEqual` trait at the beginning of the code below are object safe in a setting where this object safety leads to unsoundness.

Perhaps the case where we might want to remove object safety is best described along the lines of:
* a trait with associated types
* with a generic implementation that overlaps with the trait’s own trait object type
  * in particular, a fully generic implementation like below has this overlap
  * in these situation, trait objects already show some kind of “specialization” behavior in current stable Rust
* where the generic implementation uses the `Self` type in at least one of the associated type definitions (e.g. how the implementation of `IsEqual for A` uses `A` in the `type To`).

_^^^ Just a guess. No idea if this actually catches all the problems or if might be too restrictive._

```rust
trait IsEqual {
    type To: ?Sized;
}
impl<A: ?Sized> IsEqual for A {
    type To = A;
}

static X: usize = 12345;

fn main() {
    let x = cast_reference::<usize, [usize; i32::MAX as _]>(&X);
    assert_eq!(x[0], 12345); // works, nice!

    // let’s keep reading the rest of static memory and whatever follows:
    println!("{:x?}", &x[1..]);

    // eventually segfaults
}

#[repr(C)]
// reinterpreting a `&Struct<dyn ..., S, T>`
// as a `&Struct<(), S, T>`
// will conveniently give acess to the old `S` field
// through the new `T` field
struct Struct<'a, 'r, A: ?Sized, S, T>(&'a A, &'r S, Option<&'r T>);

// since we’re nice, we’ll make sure the lifetimes match ^^
fn cast_reference<S, T>(s: &S) -> &T {
    fn f<'r, S, T>(v: &Struct<'_, 'r, (), S, T>) -> &'r T {
        // accessing the `T` field
        v.2.unwrap()
    }
    // since `IsEqual<To = ()>` is apparently object safe, we have
    // dyn IsEqual<To = ()>: IsEqual<To = ()>
    // passing A == dyn IsEqual<To = ()> to step_one
    // requires f’s parameter to be
    // &Struct<<dyn IsEqual<To = ()> as IsEqual>::To, S, T>
    // i.e.
    // &Struct<(), S, T>
    step_one::<dyn IsEqual<To = ()>, S, T>(&(), s, f::<S, T>)
}

fn step_one<'r, A: ?Sized, S, T>(
    x: &A,
    s: &'r S,
    f: fn(&Struct<'_, 'r, <A as IsEqual>::To, S, T>) -> &'r T,
) -> &'r T {
    // now that we forgot about the fact that `A` is a trait object,
    // we can instead look at the generic 
    // impl<A: ?Sized> IsEqual for A {
    //     type To = A;
    // }
    // For that reason, “clearly”
    // <A as IsEqual>::To == A !!
    // Thus, `f` takes a
    // &Struct<<A as IsEqual>::To, S, T>
    // i.e.
    // &Struct<A, S, T>
    step_two::<A, S, T>(x, s, f)
}

fn step_two<'r, A: ?Sized, S, T>(
    x: &A,
    s: &'r S,
    f: fn(&Struct<'_, 'r, A, S, T>) -> &'r T,
) -> &'r T {
    // this function will be called with
    // A == dyn IsEqual<To = ()>
    // but `f` is “originally” a function pointer
    // accepting &Struct<(), S, T>
    // so we in effect reinterpret the passed argument
    // of type &Struct<dyn ..., S, T>
    f(&Struct(x, s, None))
}

```

