_Edit:_

Also, I don’t know if “I-unsound” supersedes “I-ICE”. I ran into about 10 different kinds of ICEs before I got this to create a segfault, so “I-ICE” might very well apply, too. Actually, it’s pretty nice that there are all these things that you _can’t_ get the code generation to accept, even with a hole like this in the typesystem.

One thing that, surprisingly, _didn’t_ ICE was requesting the size of an unsized type. Instead, it just returns `0`.
```rust
trait IsEqual {
    type To: ?Sized;
}
impl<A: ?Sized> IsEqual for A {
    type To = A;
}

fn main() {
    // call works since
    // dyn IsEqual<To = u64>: IsEqual<To = u64>,
    // hence
    // <dyn IsEqual<To = u64> as IsEqual>::To == u64
    // which is Sized
    argument_equal_to_sized_type::<dyn IsEqual<To = u64>>();
}

fn argument_equal_to_sized_type<T: ?Sized>()
where
    <T as IsEqual>::To: Sized,
{
    // call works, since
    // <T as IsEqual>::To
    // reduces to
    // T
    // by the generic impl above
    argument_sized::<T>();
}

fn argument_sized<T>() {
    println!("{}", std::any::type_name::<T>());
    println!("{}", std::mem::size_of::<T>());
}
```
